import React from 'react';
import {
    View,
    Text
} from 'react-native'
import {COLORS,icons} from '../constants';

const SplashScreen = ()=>{
    return(
      <View style={{flex:1,backgroundColor:COLORS.lightBlue}}>
        <Image source={icons.biome} />
      </View>
    )
  }

export default SplashScreen;
